  `Ac_Contra` varchar(255) NOT NULL,
  `Ac_Rol` int(11) NOT NULL,
  PRIMARY KEY (`Ac_Codi`),
  UNIQUE KEY `Ac_Cedu` (`Ac_Cedu`),
