/*Table structure for table `producto` */

DROP TABLE IF EXISTS `producto`;

CREATE TABLE `producto` (
  `id_producto` int(11) NOT NULL AUTO_INCREMENT,
  `id_categoria` int(11) NOT NULL,
  `nombre` varchar(100) NOT NULL,
  `precio` float NOT NULL,
  `imagen` int(11) NOT NULL,
  PRIMARY KEY (`id_producto`),
  KEY `id_categoria` (`id_categoria`),
  KEY `producto_ibfk_2` (`imagen`),
  CONSTRAINT `producto_ibfk_1` FOREIGN KEY (`id_categoria`) REFERENCES `categoria` (`id_categoria`) ON UPDATE CASCADE,
  CONSTRAINT `producto_ibfk_2` FOREIGN KEY (`imagen`) REFERENCES `imagen` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

/*Data for the table `producto` */

insert  into `producto`(`id_producto`,`id_categoria`,`nombre`,`precio`,`imagen`) values (41,4,'A',100,9),(42,5,'B',200,10);

/*Table structure for table `roles` */

DROP TABLE IF EXISTS `roles`;

CREATE TABLE `roles` (
  `id_rol` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_rol` varchar(50) NOT NULL,
  `descripcion` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_rol`),
  UNIQUE KEY `nombre_rol` (`nombre_rol`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `roles` */

insert  into `roles`(`id_rol`,`nombre_rol`,`descripcion`) values (1,'admin',NULL),(2,'cajero',NULL),(3,'mesero',NULL);

/*Table structure for table `usuarios` */

DROP TABLE IF EXISTS `usuarios`;

CREATE TABLE `usuarios` (
  `Cedula` decimal(10,0) NOT NULL,
  `Nombres` varchar(50) NOT NULL,
  `Apellidos` varchar(50) NOT NULL,
  `Fecha_nacimiento` date NOT NULL,
  `Direccion` varchar(100) NOT NULL,
  `Email` varchar(100) DEFAULT NULL,
  `Telefono` decimal(10,0) NOT NULL,
  PRIMARY KEY (`Cedula`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `usuarios` */

insert  into `usuarios`(`Cedula`,`Nombres`,`Apellidos`,`Fecha_nacimiento`,`Direccion`,`Email`,`Telefono`) values (1112226107,'DAVID','ARISTIZABAL PEÑARANDA','1992-11-01','CALLE 27#16-83',NULL,2865646),(1113663691,'ANDERSON','HINCAPIE','1993-07-20','CLL 41 # 26 -41','anderson.hincapie.t@gmail.com',3192357808);

